import React from "react";
import Login from "./components/Login/Login"
import Adminpage from "./components/Admin/AdminPage";

const App = () => {
  return (
    <>
      <Route path="/" component={Login} />
      <Route path="/profile" component={Adminpage} />
    </>
  );
};

export default App;
